import React, { Component } from "react";

class Todo extends Component {
  render() {
    return (
      <div className="alert alert-warning">
        <div>{props.desc}</div>
        <div className="d-flex flex-row align-items-center">
          <input
            type="checkbox"
            className="mr-2"
            onChange={props.handleTaskComplete}
          />
          <span>Completed</span>
        </div>
      </div>
    );
  }
}

export default Todo;
